import React from "react";
import "./Calendar.css";

function Calendar({ onClose }) {
  return (
    <div className="calendar-popup">
      <h3>Выберите дату</h3>
      <button onClick={onClose}>Закрыть</button>
      {/* Здесь будет календарь */}
    </div>
  );
}

export default Calendar;
